import{_ as t,a as o,b as n,c as i,d as s}from"./chunks/hovergames_colored_small.B7z1rbKS.js";import{_ as l,c as p,j as r,a as d,G as c,a8 as h,B as u,o as m}from"./chunks/framework.BDnHobkS.js";const x=JSON.parse('{"title":"NXP RDDRONE-FMUK66 FMU (Discontinued)","description":"","frontmatter":{},"headers":[],"relativePath":"ko/flight_controller/nxp_rddrone_fmuk66.md","filePath":"ko/flight_controller/nxp_rddrone_fmuk66.md"}'),f={name:"ko/flight_controller/nxp_rddrone_fmuk66.md"};function g(b,e,k,w,D,_){const a=u("Badge");return m(),p("div",null,[e[0]||(e[0]=r("h1",{id:"nxp-rddrone-fmuk66-fmu-discontinued",tabindex:"-1"},[d("NXP RDDRONE-FMUK66 FMU (Discontinued) "),r("a",{class:"header-anchor",href:"#nxp-rddrone-fmuk66-fmu-discontinued","aria-label":'Permalink to "NXP RDDRONE-FMUK66 FMU (Discontinued)"'},"​")],-1)),c(a,{type:"info",text:"Discontinued"}),e[1]||(e[1]=h('<div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>This flight controller has been <a href="./../flight_controller/autopilot_experimental.html">discontinued</a> and is no longer commercially available.</p></div><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 does not manufacture this (or any) autopilot. Contact the <a href="https://www.nxp.com/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p>RDDRONE-FMUK66 FMU는 2 자동차 이더넷 100BASET1 및 보안 요소 A71CH (RevC) 또는 SE050 (RevD)을 추가하여 Pixhawk FMUv4 사양을 준수하는 NXP Semiconductor 구성 요소를 사용하는 참조 설계입니다. NXP는 이 설계를 복제, 변경 또는 재활용 할 수 있도록 회로도, 거버, BOM 및 소스 파일을 제공합니다.</p><p>This is the official FMU for use with <a href="https://www.hovergames.com/" target="_blank" rel="noreferrer">HoverGames</a>.</p><p><img src="'+t+'" alt="RDDRONE-FMUK66 FMU Hero Image1"></p><p><img src="'+o+'" alt="RDDRONE-FMUK66 FMU Hero Image2"></p><p>NXP FMU와 포함된 주변 장치는 FCC/CE/RoHs/REACH 지침을 준수합니다.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>이 비행 컨트롤러는 <a href="./../flight_controller/autopilot_manufacturer_supported.html">제조업체에서 지원</a>합니다.</p></div><h2 id="요약" tabindex="-1">요약 <a class="header-anchor" href="#요약" aria-label="Permalink to &quot;요약&quot;">​</a></h2><ul><li><strong>Main FMU Processor:</strong><ul><li>180MHz Cortex-M4F MCU, 2MB 플래시, 256KB SRAM, 듀얼 USB (FS + HS), 이더넷, 144-LQFP에서 실행되는 Kinetis K66 MK66FN2MOVLQ18 마이크로 컨트롤러.</li></ul></li><li><strong>On-board sensors:</strong><ul><li>가속/자이로: BMI088/ICM42688 (RevD) ...</li><li>가속/자력계: FXOS8700CQ</li><li>자이로: FXAS21002CQ</li><li>자력계: BMM150</li><li>기압계: ML3115A2</li><li>Barometer: BMP280</li></ul></li><li><strong>GPS:</strong><ul><li>u-blox Neo-M8N GPS/GLONASS 수신기; 통합 자력계 IST8310</li></ul></li></ul><p>This FMU is provided only as a kit, and includes <a href="https://www.segger.com/products/debug-probes/j-link/models/j-link-edu-mini/" target="_blank" rel="noreferrer">Segger Jlink EDU mini debugger</a>, DCD-LZ debugger adapter, USB-TTL-3V3 console cable, HolyBro GPS module, battery power module, SDCard and case, screws and stickers. Telemetry radios (<a href="https://www.nxp.com/part/HGD-TELEM433" target="_blank" rel="noreferrer">HGD-TELEM433</a> and <a href="https://www.nxp.com/part/HGD-TELEM915" target="_blank" rel="noreferrer">HGD-TELEM915</a>) must be purchased separately to match ISM band frequencies used in your country.</p><p><img src="'+n+'" alt="RDDRONE-FMUK66 FMU Kit"></p><p>A &quot;Lite&quot; version RDDRONE-FMUK66L is also available which does not include the power module, GPS, Jlink or USB-TTL-3V3 console cable or SDCard.<a href="https://www.nxp.com/design/designs/px4-robotic-drone-fmu-rddrone-fmuk66:RDDRONE-FMUK66#buy" target="_blank" rel="noreferrer">Scroll down to see FMUK66L in the buy section of the FMUK66 buy page</a></p><p>Additional information can be found in the <a href="https://www.nxp.com/design/designs/px4-robotic-drone-fmu-rddrone-fmuk66:RDDRONE-FMUK66" target="_blank" rel="noreferrer">Technical Data Sheet</a>. </p><h2 id="구매처" tabindex="-1">구매처 <a class="header-anchor" href="#구매처" aria-label="Permalink to &quot;구매처&quot;">​</a></h2><p><strong>RDDRONE-FMUK66</strong> reference design kit may be purchased direct from NXP or from any of NXP&#39;s authorised worldwide network of <a href="https://www.nxp.com/support/sample-and-buy/distributor-network:DISTRIBUTORS" target="_blank" rel="noreferrer">electronics distributors</a>.</p><ul><li><a href="https://www.nxp.com/design/designs/px4-robotic-drone-fmu-rddrone-fmuk66:RDDRONE-FMUK66#buy" target="_blank" rel="noreferrer">Purchase Link</a> (www.nxp.com)</li><li>원격 측정 라디오는 주파수 대역에 따라 별도로 구매하여야 합니다. <ul><li><a href="https://www.nxp.com/part/HGD-TELEM433" target="_blank" rel="noreferrer">HGD-TELEM433</a></li><li><a href="https://www.nxp.com/part/HGD-TELEM915" target="_blank" rel="noreferrer">HGD-TELEM915</a></li></ul></li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p><em>RDDRONE-FMUK66</em> FMU is also included in the complete HoverGames drone kit: <a href="https://www.nxp.com/applications/solutions/industrial/aerospace-and-mobile-robotics/uavs-drones-and-rovers/nxp-hovergames-drone-kit-including-rddrone-fmuk66-and-peripherals:KIT-HGDRONEK66#buy" target="_blank" rel="noreferrer">KIT-HGDRONEK66</a></p></div><h2 id="조립-및-설정" tabindex="-1">조립 및 설정 <a class="header-anchor" href="#조립-및-설정" aria-label="Permalink to &quot;조립 및 설정&quot;">​</a></h2><p><a href="https://nxp.gitbook.io/hovergames" target="_blank" rel="noreferrer">https://nxp.gitbook.io/hovergames</a></p><h2 id="펌웨어-빌드" tabindex="-1">펌웨어 빌드 <a class="header-anchor" href="#펌웨어-빌드" aria-label="Permalink to &quot;펌웨어 빌드&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Most users will not need to build this firmware! It is pre-built and automatically installed by <em>QGroundControl</em> when appropriate hardware is connected.</p></div><p>To <a href="./../dev_setup/building_px4.html">build PX4</a> for this target:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>make nxp_fmuk66-v3_default</span></span></code></pre></div><h2 id="디버그-포트" tabindex="-1">디버그 포트 <a class="header-anchor" href="#디버그-포트" aria-label="Permalink to &quot;디버그 포트&quot;">​</a></h2><p>The <a href="./../debug/system_console.html">PX4 System Console</a> and the <a href="./../debug/swd_debug.html">SWD interface</a> run on the <a href="https://nxp.gitbook.io/hovergames/rddrone-fmuk66/connectors/debug-interface-dcd-lz" target="_blank" rel="noreferrer">DCD-LZ FMU Debug</a> port.</p><p>NXP&#39;s DCD-LZ is a 7 pin JST-GH connector and adds the nRST/MCU_RESET pin to the <a href="https://github.com/pixhawk/Pixhawk-Standards/blob/master/DS-009%20Pixhawk%20Connector%20Standard.pdf" target="_blank" rel="noreferrer">Pixhawk 6-Pin standard debug port</a>.</p><p>DCD-LZ 브레이크아웃 어댑터를 사용하면 표준 10핀 JTAG/SWD 인터페이스(예 : Segger Jlink 사용) 및 표준 5핀 FTDI USB-TTL-3V3 유형 케이블을 사용할 수 있습니다.</p><h2 id="지원-플랫폼-및-기체" tabindex="-1">지원 플랫폼 및 기체 <a class="header-anchor" href="#지원-플랫폼-및-기체" aria-label="Permalink to &quot;지원 플랫폼 및 기체&quot;">​</a></h2><p>일반 RC 서보 또는 Futaba S-Bus 서보로 제어 가능한 모든 멀티콥터/비행기/로버 또는 보트. The complete set of supported configurations can be seen in the <a href="./../airframes/airframe_reference.html">Airframes Reference</a>.</p><p><img src="'+i+'" alt="HoverGames Drone Kit"></p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>The NXP <a href="https://www.nxp.com/kit-hgdronek66" target="_blank" rel="noreferrer">HoverGames Drone Kit</a> (shown above) is a complete drone development kit that includes everything needed to build a quadcopter. 3S/4S LiPo 배터리만 추가로 구매하시면 됩니다.</p></div><h2 id="추가-정보" tabindex="-1">추가 정보 <a class="header-anchor" href="#추가-정보" aria-label="Permalink to &quot;추가 정보&quot;">​</a></h2><ul><li><p><a href="https://nxp.gitbook.io/hovergames" target="_blank" rel="noreferrer">HoverGames online documentation</a> PX4 user and programming guide, specific assembly, construction, debugging, programming instructions.</p></li><li><p>3DModels supporting HoverGames and RDDRONE-FMUK66 can be found on <em>Thingiverse</em> at these search links: <a href="https://www.thingiverse.com/search?q=fmuk66&amp;type=things&amp;sort=relevant" target="_blank" rel="noreferrer">fmuk66</a>, <a href="https://www.thingiverse.com/search?q=hovergames&amp;type=things&amp;sort=relevant" target="_blank" rel="noreferrer">hovergames</a>.</p></li></ul><p><img src="'+s+'" alt="HoverGamesDronelogo"></p>',35))])}const R=l(f,[["render",g]]);export{x as __pageData,R as default};
